webpackJsonp([0x6993ce0c64e3],{303:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Welcome to the MicroFeedback docs.</p>\n<h2 id="what-is-microfeedback"><a href="#what-is-microfeedback" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>What is MicroFeedback?</h2>\n<p>MicroFeedback is a collection of microservices and UI components for\ncollecting user feedback.</p>\n<p>Once you have a MicroFeedback backend deployed and a UI component on your site, user feedback\nwill be posted to your issue tracker (e.g., on GitHub or in JIRA).</p>\n<p>MicroFeedback aims to provide a <strong>no-cost, easily-deployable, and open\nsource solution</strong> for collecting feedback about your website or app.</p>\n<h2 id="features"><a href="#features" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Features</h2>\n<ul>\n<li>Users don’t need to sign up to your issue tracker service in order to submit feedback.</li>\n<li>Client information (browser, operating system) is included with every issue.</li>\n<li>Spam detection using Akismet.</li>\n<li>Toxicity scoring with the Perspective API.</li>\n<li>Attach arbitrary metadata (e.g. user information) to issues.</li>\n<li>Deploy easily to Now or Heroku—no databases or addons necessary.</li>\n</ul>\n<h2 id="next-steps"><a href="#next-steps" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Next steps</h2>\n<ul>\n<li>If you’re just starting out, check out the <a href="/getting-started/core-concepts">Core Concepts</a> page to learn about the two components\nof the MicroFeedback project: <em>Backends</em> and <em>UI Components</em>.</li>\n<li>For guides on how to deploy MicroFeedback backends, see the\n<a href="/getting-started/deployment">Deployment</a> page.</li>\n<li>If you’re looking for documentation on a specific backend, see the\n<a href="/backends/">Backends</a> page.</li>\n<li>If you need to add a feedback button to your site, see <a href="/ui-components/microfeedback-button">microfeedback-button</a>.</li>\n</ul>',headings:[{value:"What is MicroFeedback?",depth:2},{value:"Features",depth:2},{value:"Next steps",depth:2}],frontmatter:{title:"Getting Started"},fields:{sectionList:'[{"title":"Getting started","items":[{"id":"index","title":"Welcome!","slug":"/getting-started/"},{"id":"core-concepts","title":"Core Concepts","slug":"/getting-started/core-concepts"},{"id":"deployment","title":"Deployment","slug":"/getting-started/deployment"}]}]',path:"getting-started/index.md",slug:"/getting-started/",dir:"getting-started"}}},pathContext:{slug:"/getting-started/"}}}});
